import React from "react";
import { Link } from "react-router-dom";

export default function Menu()
{
    return (
        <nav>
            <Link to="/">Home</Link>
            <Link to="/bio">Bio</Link>
            <Link to="/fa">Bio</Link>
            <Link to="/bio">Bio</Link>
        </nav>
    );
}
